import React from 'react';
import '../css/VideoHistory.css';
import exit from '../resources/exit.png';
import carOnFire from '../resources/videos/car-on-fire.png';
import carCrash from '../resources/videos/car-crash.png';
import houseFire from '../resources/videos/house-fire.png';
import robbery from '../resources/videos/robbery.png';
import trafficJam from '../resources/videos/traffic-jam.png';

function VideoHistory(props) {
  const { toggleVideoHistory } = props;
  const videoSources = [carOnFire, carCrash, '', houseFire, robbery, trafficJam];

  return (
    <div id="video-history">
      <div id="video-history-wrapper">
        <div id="close-video-history">
        <img src={exit} alt="" onClick={toggleVideoHistory} />
        </div>
        <p id="video-history-text">Watch previous videos!</p>
        <div id="video-history-list">
          {videoSources.map((src, index) => (
            <div className={`video-history-item ${src === '' ? 'hidden-video-history-item' : ''}`} key={index}>
              {src !== '' && <video src={src} alt="" />}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default VideoHistory;
